// Floating-point calculations seem to be different between amd64 and arm64, which I didn't expect. For now, limiting
// the test to run only on amd64.

//go:build amd64

package visibility_test

import (
	"testing"

	"github.com/richardwilkes/toolbox/check"
	"github.com/richardwilkes/toolbox/xmath"
	"github.com/richardwilkes/toolbox/xmath/geom"
	"github.com/richardwilkes/toolbox/xmath/geom/poly"
	"github.com/richardwilkes/toolbox/xmath/geom/visibility"
	"golang.org/x/exp/constraints"
)

func TestVisibility(t *testing.T) {
	visibilityHelper(t, expectedFloat64)
}

func TestVisibility32(t *testing.T) {
	visibilityHelper(t, expectedFloat32)
}

func visibilityHelper[T constraints.Float](t *testing.T, expected []poly.Polygon[T]) {
	t.Helper()
	segments := []visibility.Segment[T]{
		{Start: geom.Point[T]{X: 400, Y: 350}, End: geom.Point[T]{X: 450, Y: 400}},
		{Start: geom.Point[T]{X: 400, Y: 200}, End: geom.Point[T]{X: 550, Y: 450}},
		{Start: geom.Point[T]{X: 450, Y: 500}, End: geom.Point[T]{X: 600, Y: 250}},
		{Start: geom.Point[T]{X: 300, Y: 300}, End: geom.Point[T]{X: 650, Y: 400}},
	}
	r := segments[0].Bounds()
	for _, s := range segments[1:] {
		r.Union(s.Bounds())
	}
	center := r.Center()
	distance := max(r.Width, r.Height)
	r.InsetUniform(-distance)
	vis := visibility.New(r, segments, false)
	for i := 0; i < 360; i++ {
		angleInRadians := xmath.Pi * 2 * T(i) / 360
		viewPt := geom.Point[T]{
			X: center.X + xmath.Cos(angleInRadians)*distance,
			Y: center.Y + xmath.Sin(angleInRadians)*distance,
		}
		check.Equal(t, expected[i], vis.SetViewPoint(viewPt), "TestVisibility (%#T) #%d", viewPt.X, i)
	}
}

